import React from "react";

const TableBody = props => {
    const {data,columns}=props;
  return (

    <>
      <tbody>
        {data.map((it, index) => {
          //  console.log(it);

          return (
            <tr key={index}>
              <td>{it.title}</td>
              <td>{it.description}</td>
                <td></td>
            </tr>
          );
        })}
      </tbody>
    </>
  );
};

export default TableBody;
